import React from 'react'
import CartItem from './CartItem'

function Cart({ products, cart, handler }) {
    return (
        Object.keys(cart).map(key => {
            return <CartItem key={key} product={products.find(prod => Number(prod.id) === Number(key))} count={cart[key]} deletionHandler={handler} />
        })
    )
}

export default Cart
